import React from "react";
import "./form.css";

const FormSection = () => {
  return (
    <>
      <div className="form-container">
        <div className="faq">
          <div className="box">
            <div className="bar-red"></div>
            <span>FAQ</span>
          </div>
          <h2>Frequently asked questions</h2>
          <Expandtoggle
            btnText={"What are the Benifits of Business"}
            togglePara={
              "Lorem ipsum is placeholder text commonly used to demonstrate the visual form of a document. used to demonstrate the visual form of a document."
            }
          />
        </div>
        <div className="form">
          <label for="dog-names">Choose a dog name:</label>
          <select name="dog-names" id="dog-names">
            <option value="rigatoni">Rigatoni</option>
            <option value="dave">Dave</option>
            <option value="pumpernickel">Pumpernickel</option>
            <option value="reeses">Reeses</option>
          </select>
        </div>
      </div>
    </>
  );
};
export default FormSection;

function Expandtoggle(props) {
  return (
    <>
      <div className="toggle-container">
        <button className="toggle-expand" onClick={click}>
          <div className="toggle-img"></div>
          <span>{props.btnText}</span>
          <div className="plus-minus">
            <i class="fa-solid fa-plus"></i>
          </div>
        </button>
        <p id="para">{props.togglePara}</p>
      </div>
    </>
  );
}
function click() {
  var x = document.getElementById("para");
  if (x.style.display === "none") {
    x.style.display = "block";
  } else {
    x.style.display = "none";
  }
}
